      <div className="container">

        {/* ゲーム */}
        {/* スライド部分 */}
        <div className="game-slide">
          {data.allMicrocmsBlogs.edges.map(({ node }) => (
            <span key={node.id}>
              <figure>
                {/* とりあえずimgタグで指定、未最適化 */}
                <img src={node.eyecatch.url} alt="eyecatch" />
              </figure>
            </span>
          ))}
        </div>

        <div className="game-title">
          <h1>ゲーム</h1>
          <h3>ドットひとつに魂をこめて</h3>
        </div>

        {/* ここから記事一覧 */}
        <div className="game-post">
          {data.allMicrocmsBlogs.edges.map(({ node }) => (
            <article key={node.id}>
              <Link to={`/blog/post/${node.category.categorySlug}/${node.slug}`}>
                <section>
                  <figure>
                    {/* とりあえずimgタグで指定、未最適化 */}
                    <ImgixGatsbyImage
                      src={node.eyecatch.url}
                      imgixParams={{ auto: ["format", "compress"] }}
                      layout="constrained"
                      sourceWidth={node.eyecatch.width}
                      sourceHeight={node.eyecatch.height}
                      style={{ width: "100%" }}
                      alt={`eyecatch ${node.title}`}
                    />
                  </figure>
                  <h4>{node.publicDate}</h4>
                  <h3>{node.title}</h3>
                </section>
              </Link>
            </article>
          ))}
        </div>
        <div className="page-last">
          <span>--- ここが地獄だ ---</span>
        </div>
      </div>

      {/* 区切れ目*/ }
